uBCD1\uC744 \uC553\uAE30 \uC2DC\uC791\uD55C \uC544\uAE30\uAC00 \uC788\uC2B5\uB2C8\uB2E4. \uCE58\uB8CC\uD558\uC9C0 \uBABB\uD560 \uACBD\uC6B0 \uCE58\uBA85\uC801\uC778 \uC774 \uBCD1\uC758 \uD655\uC0B0\uC744 \uB9C9\uAE30 \uC704\uD55C \uC720\uC77C\uD55C \uBC29\uBC95\uC740 \uD56D\uC0DD\uC81C\uB97C \uC0AC\uC6A9\uD558\uB294 \uAC83\uC785\uB2C8\uB2E4. \uB2F9\uC2E0\uC758 \uAC00\uC871\uC740 \uC74C\uC2DD\uC774 \uBC14\uB2E5\uB098\uACE0 \uC788\uC9C0\uB9CC, \uBA70\uCE60\uB3D9\uC548 \uD544\uC694\uD55C \uCDA9\uBD84\uD55C \uC591\uC758 \uC0DD\uC218\uAC00 \uC788\uC2B5\uB2C8\uB2E4. \uB9C8\uC744\uC758 \uBAA8\uB4E0 \uAC00\uAC8C\uB294 \uBB38\uC744 \uB2EB\uC558\uC73C\uBA70, \uB530\uB77C\uC11C \uB2F9\uC2E0\uC774 \uBB3C\uAC74\uC744 \uAD6C\uB9E4\uD560 \uC218 \uC788\uB294 \uD604\uAE08\uC744 \uC0AC\uC6A9\uD560 \uC218 \uC788\uB294\uC9C0\uC758 \uC5EC\uBD80\uB294 \uBD88\uD22C\uBA85\uD569\uB2C8\uB2E4. \uC8FC\uC5B4\uC9C4 \uC0C1\uD669\uC5D0\uC11C, \uB2F9\uC2E0\uC740 \uB2E4\uC74C\uC8FC\uC5D0 \uB354\uC774\uC0C1\uC758 \uAD6C\uD638\uBB3C\uC790\uB97C \uBC1B\uC9C0 \uBABB\uD55C\uB2E4\uB294 \uAC83\uC744 \uC54C\uAC8C \uB418\uC5C8\uC2B5\uB2C8\uB2E4. \uAD6C\uD638\uBB3C\uC790\uB294 \uD56D\uC0DD\uC81C\uB97C \uBE44\uB86F\uD55C \uAD6C\uAE09\uC57D, \uD1B5\uC870\uB9BC \uC74C\uC2DD, \uC57D\uAC04\uC758 \uD604\uAE08\uACFC \uC0DD\uC218\uB97C \uD3EC\uD568\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.<\/p><p>\uC774\uC5B4\uC9C0\uB294 \uAC8C\uC784\uC5D0\uC11C, \uB2F9\uC2E0\uC740 \uB2F9\uC2E0\uC758 \uAC00\uC871\uACFC \uB2E4\uB978 \uAC00\uC871\uC774 \uC5B4\uB5BB\uAC8C \uAD6C\uD638\uBB3C\uC790\uB97C \uB098\uB204\uC5B4 \uAC00\uC9C8 \uAC83\uC778\uC9C0\uC5D0 \uB300\uD574 \uD611\uC758\uD574\uC57C \uD569\uB2C8\uB2E4. \uB2F9\uC2E0\uC740 \uC0C1\uB300\uBC29 \uAC00\uC871\uC774 \uC5BC\uB9CC\uD07C\uC758 \uC74C\uC2DD\uACFC \uBB3C\uC744 \uAC00\uC9C0\uACE0 \uC788\uB294\uC9C0 \uBAA8\uB974\uACE0 \uC788\uC2B5\uB2C8\uB2E4.<\/p><p>\uD611\uC0C1\uC740 \uBC88\uAC08\uC544\uAC00\uBA70 \uAC70\uB798\uB97C \uC81C\uC548\uD558\uB294 \uAC83\uC73C\uB85C \uC9C4\uD589\u 4 \uB418\uB294 \uBB38\uC81C\uC5D0 \uB300\uD574 \uC758\uACAC \uD569\uC77C\uC5D0 \uB2E4\uB2E4\uB974\uB824 \uB178\uB825\uD558\uB294 \uAC83\uC73C\uB85C\uC11C, \uBB34\uC5ED, \uC0C1\uAC70\uB798, \uC77C\uC0C1\uC801\uC778 \uC758\uC0AC\uACB0\uC815\uC758 \uC911\uC694\uD55C \uBD80\uBD84\uC774\uBA70 \uD604\uB300 \uC0AC\uD68C\uC5D0\uC11C \uADF8 \uC911\uC694\uC131\uC774 \uB354\uC6B1 \uCEE4\uC9C0\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uADC0\uD558\uAC00 \uCC38\uC5EC\uD558\uAC8C \uB420 \uD611\uC0C1\uC740 \uC5EC\uB7EC \uBB3C\uD488\uC5D0 \uB300\uD55C \uC18C\uC720\uAD8C, \uC608\uB97C \uB4E4\uC5B4 \uC0DD\uC218 \uB610\uB294 \uB610\uB294 \uC74C\uC2DD\uC5D0 \uB300\uD55C \uC18C\uC720\uAD8C\uC744 \uD3EC\uD568\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.<br />\uADC0\uD558\uB294 \uBCF8\uC778 \uC790\uC2E0\uC744 \uC704\uD574 \uB0A8\uACA8\uB450\uACE0 \uC2F6\uC740 \uBB3C\uD488\uC5D0 \uAE30\uCD08\uD558\uC5EC \uC0C1\uB300\uBC29\uC5D0\uAC8C \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uBB3C\uD488\uC744 \uC591\uBCF4\uD560 \uAC83\uC778\uAC00\uB97C \uACB0\uC815\uD558\uAC8C \uB429\uB2C8\uB2E4. \uB2E4\uB978 \uCC38\uAC00\uC790\uC640 \uD568\uAED8 \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uBB3C\uD488\uC744 \uC0C1\uB300\uBC29\uC5D0\uAC8C \uC591\uBCF4\uD560 \uAC83\uC778\uC9C0, \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uBB3C\uD488\uC744 \uBCF8\uC778\uC744 \uC704\uD574 \uB0A8\uACA8\uB458 \uAC83\uC778\uC9C0\uC5D0 \uB300\uD574 \uC758\uACAC \uC77C\uCE58\uC5D0 \uB2E4\uB2E4\uB974\uAE30 \uC704\uD574 \uD611\uC0C1\uD558\uC2E4 \uAC83\uC785\uB2C8\uB2E4.<\/p><p>\uC804\uCCB4 \uC124\uBB38\uC870\uC0AC\uB294 \uC77C\uBC18\uC801\uC73C\uB85C 20\uBD84 \uAC00\uB7C9 \uC18C\uC694\uB429\uB2C8\uB2E4.<\/p><p>\uC124\uBB38\uC5D0 \uCC38\uC5EC\uD558\uC2DC\uAE30 \uC804\uC5D0 \uACFC\uD559\uC5F0\uAD6C \uCC38\uAC00\uC790\uB85C\uC11C\uC758 \uADC0\uD558\uC758 \uAD8C\uB9AC\uC5D0 \uB300\uD55C \uB0B4\uC6A9\uC744 \uB2F4\uACE0 \uC788\uB294 \uC544\uB798\uC758 "\uC5F0\uAD6C\uC870\uC0AC \uC815\uBCF4 \uBCF4\uAE30"\uB97C \uD074\uB9AD\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624. \uC774 \uBB38\uC11C\uB294 \
